import { useState, useEffect } from 'react'
import "./Cars.css"
import CarInstance from './CarInstance'

type Car = {
    strMark: string;
    strPrice: string;
    strImagePath: string;
  }  

export const Cars = () => {
    const [cars, setCars] = useState<Car[]>([]);

    useEffect(() => {
      fetch('http://127.0.0.1:63341/car/getAll')
        .then(response => response.json())
        .then(data => setCars(data))
        .catch(error => console.error(error));
    }, []);

    return (
        <div className="car-container my-4">
          <div className="row row-cols-3 gy-4 car-list" id="car-list">

            {cars.map((car, index) => (
                <CarInstance
                    key={index}
                    strMark={car.strMark}
                    strPrice={car.strPrice}
                    strImagePath={car.strImagePath}
                />
            ))}

          </div>
        </div>
    );
}
